angular.module('lx.layout', [])
    .directive('lxMenuButton', function () {
        return {
            restrict: 'A',
            scope: {
                lxMenuButton: '='
            },
            link: function (scope, elem) {

                var bodyTemp = document.getElementsByTagName('body');
                var body = angular.element(bodyTemp[0]);

                elem.bind('click', function () {
//                    console.log("btn: ",scope.lxMenuButton);
                    if (!body.hasClass(scope.lxMenuButton)) {
                        body.addClass(scope.lxMenuButton);
                    } else {
                        body.removeClass(scope.lxMenuButton);
                    }
//                    if (!body.hasClass('lx-menu-open')) {
//                        body.addClass('lx-menu-open');
//                    } else {
//                        body.removeClass('lx-menu-open');
//                    }
                });
            }
        };
    })
    .directive('lxMobileResize', function ($window, $document) {
        return {
            restrict: 'A',
            link: function () {

                var window = angular.element($window);
                var body = angular.element($document[0].body);

                function doResize () {
                    var currentWidth = $document[0].body.clientWidth;//body.width();
                    if (currentWidth <= 1024) {
                        if (body.hasClass('lx-menu-open-right')) {
                            body.removeClass('lx-menu-open-right');
                        }
                        if (body.hasClass('lx-menu-open-left')) {
                            body.removeClass('lx-menu-open-left');
                        }
                    } else {
                        if (!body.hasClass('lx-menu-open-right')) {
                            body.addClass('lx-menu-open-right');
                        }
                        if (!body.hasClass('lx-menu-open-left')) {
                            body.addClass('lx-menu-open-left');
                        }
                    }
                }

                window.bind('resize', function () {
                    doResize();
                });

                doResize();
            }
        };
    })
    .factory('lxToastBoxService', function ($timeout) {

        var pub = {};

        pub.visible = false;
        pub.timeout = 5000;

        var promise = null;

        pub.show = function (msg, type) {
            pub.visible = true;
            pub.type = type || 'default';
            pub.msg = msg;

            if (promise) {
                $timeout.cancel(promise);
            }
            promise = $timeout(function () {
                pub.close();
            }, pub.timeout);
        };

        pub.close = function () {
            pub.visible = false;
        };

        return pub;

    })
    .directive('lxToastBox', function () {
        return {
            restrict: 'E',
            replace: true,
            template: '<div id="lx-toast" class="{{obj.type}} animated" ng-class="{\'bounceInRight\': obj.visible && lxToastBoxAnimated && right,\'fadeOutRight\': !obj.visible && lxToastBoxAnimated && right,\'bounceInLeft\': obj.visible && lxToastBoxAnimated && !right,\'fadeOutLeft\': !obj.visible && lxToastBoxAnimated && !right}">' +
            '<span>{{obj.msg}}</span>' +
            '<button class="btn btn-link pull-right" ng-click="obj.close()">close</button>' +
            '<audio id="lx-toast-box-sound">' +
//                                '<source src="sound/bigbox.mp3">'+
            '<source src="data:audio/mp3;base64,">' +
//                                '<source src="sound/bigbox.ogg">'+
            '<source src="data:audio/ogg;base64,">' +
            '</audio>' +
            '</div>',
            scope: {
                obj: '=',
                lxToastBoxAnimated: '=',
                lxToastBoxSound: '='
            },
            link: function (scope, elem) {

                elem.css({display: 'none'});

                scope.right = elem.hasClass('right');

                var soundFile = document.getElementById('lx-toast-box-sound');

                scope.$watch('obj.visible', function (val) {
                    if (val) {
                        elem.unbind();
                        elem.css({display: 'block'});
                        if (scope.lxToastBoxSound) {
                            soundFile.play();
                        }
                    } else {
                        if (scope.lxToastBoxAnimated) {
                            elem.bind('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function () {
                                elem.css({display: 'none'});
                            });
                        } else {
                            elem.css({display: 'none'});
                        }
                    }
                });
            }
        };
    })
    .factory('lxMessageBoxService', function () {

        var pub = {};

        pub.visible = false;

        pub.show = function (icon, title, msg, btn, callback) {
            pub.visible = true;
            pub.icon = icon;
            pub.title = title;
            pub.msg = msg;
            pub.btn = btn;
            pub.callback = callback;
        };

        pub.close = function (value) {
            pub.visible = false;
            pub.callback(null, value);
        };

        return pub;

    })
    .directive('lxMessageBox', function () {
        return {
            restrict: 'E',
            replace: true,
            template: '<section id="lx-message-box">' + // ng-show="obj.visible">' +
            '<div class="blackBar animated" ng-class="{\'bounceInDown\': obj.visible && lxMessageBoxAnimated,\'fadeOutUp\': !obj.visible && lxMessageBoxAnimated}">' +
            '<div class="innerContainer">' +
            '<h1><i class="{{obj.icon}}" ng-if="obj.icon.length>0"></i> {{obj.title}}</h1>' +
            '<p>{{obj.msg}}</p>' +
            '<div style="text-align:right;">' +
            '<button ng-repeat="btns in obj.btn" class="btn btn-primary" ng-click="obj.close(btns)">{{btns}}</button>' +
            '</div>' +
            '</div>' +
            '</div>' +
            '</section>',
            scope: {
                obj: '=',
                lxMessageBoxAnimated: '='
            },
            link: function (scope, elem) {

                var child = angular.element(elem.children()[0]);

                elem.css({display: 'none'});

                scope.$watch('obj.visible', function (val) {
                    if (val) {
                        child.unbind();
                        elem.css({display: 'block'});
                    } else {
                        if (scope.lxMessageBoxAnimated) {
                            child.bind('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function () {
                                elem.css({display: 'none'});
                            });
                        } else {
                            elem.css({display: 'none'});
                        }
                    }
                });
            }
        };
    })
    .directive('lxShortcutButton', function () {
        return {
            restrict: 'A',
            link: function (scope, elem) {

                var shortcutMenuTemp = document.getElementById('lx-shortcut');
                var shortcutMenu = angular.element(shortcutMenuTemp);
                var docum = angular.element(document);
                var closeable = true;

                elem.bind('click', function () {
                    closeable = false;
                    shortcutMenu.css({display: 'block'});
                    shortcutMenu.removeClass();
                    shortcutMenu.addClass('animated bounceInDown');
                    shortcutMenu.bind('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function () {
                        shortcutMenu.removeClass('animated bounceInDown');
                        shortcutMenu.unbind();

                        closeable = true;

                        docum.bind('click', function () {
                            if (shortcutMenu.css('display') !== 'none' && closeable) {
                                shortcutMenu.addClass('animated bounceOutUp');
                                shortcutMenu.bind('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function () {
                                    shortcutMenu.css({display: 'none'});
                                    shortcutMenu.removeClass('animated bounceOutUp');
                                    closeable = false;
                                    shortcutMenu.unbind();
                                    docum.unbind();
                                });

                            }
                        });
                    });
                });
            }
        };
    })
